import { combineReducers } from "redux";

import {
  findUnitById,
  findUnits,
  deletedById,
  editUnitById,
  addUnits
} from "./units";

import {
  findTransactionsById,
  findTransactions,
  deletedTransactionsById,
  editTransactionById,
  addTransactions
} from "./transactions";

export default combineReducers({
  deletedById,
  findUnitById,
  findUnits,
  editUnitById,
  addUnits,
  findTransactionByid,
  findTransactions,
  deletedTransactionsById,
  editTransactionById,
  addTransactions
});
